window.sm2.getSearchbarApi = function queueSearchbarApiRequest(...args) {
  const queue = (window[Symbol.for("sm2.getSearchbarApi.pending")] ??= []);
  let resolve;
  let reject;
  const promise = new Promise((res, rej) => {
    resolve = res;
    reject = rej;
  });
  queue.push({ args, resolve, reject });
  return promise;
};

